values:
&nbsp;&nbsp;&nbsp;&nbsp; I had a camp in on thursday, and unfortunatly sleep was difficult to find due to the fact that the motion sensor was going of the entire time.&nbsp; Drove me crazy, not to mention Kelly and Jessika.&nbsp; At least (being my mothers daughter) I was able to zone out every few minutes.&nbsp; I made it home around 9:30 am in order to sleep for a few hours.&nbsp; However, being the paranoid freak that I am, I didn't nap for fear of not waking up by noon to go back to work for a six hour shift.&nbsp;&nbsp;
After getting back home after my last shift I was so tired that it was impossible to sleep.&nbsp; It wasn't till around 3:30 in the morning that I decided to lay down.&nbsp;&nbsp;&nbsp; To say the list I didn't wake until noon and within 20 minutes went back to bed. Slept through the rest of the day.

&nbsp;&nbsp;&nbsp;&nbsp;
&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;I've dedicated the rest of the weekened to cleaning and studying.&nbsp; I've already taken a sizeanle chunk out of my work load and am quite pleased with myself.&nbsp; see&nbsp; ya later
